import React, { useState } from 'react';
import { FiMenu } from "react-icons/fi";
import { RxCross1 } from "react-icons/rx";

const Navbar = () => {
     const [nav, setNav] = useState()
  return (
      <div className='flex justify-between items-center h-24 max-w-[1200px] mx-auto px-4 text-white'>
          <h1 className='w-full text-4xl text-amber-400 font-extrabold'>REACT.</h1>
          <ul className='flex hidden'>
              <li className='p-4'>Home</li>
              <li className='p-4'>About</li>
              <li className='p-4'>Contact</li>
              <li className='p-4'>Login</li>
          </ul>
          <div onClick={handleNav}>
              {!nav ? <RxCross1 size={20}/>: <FiMenu size={20}/>}
          </div>
          <div className='fixed left-0 top-0 w-[60%] h-full border-r border-r-gray-500 bg-gray-400'>
          <h1 className='w-full text-4xl text-amber-400 font-extrabold m-3 p-4'>REACT.</h1>

              <ul className='uppercase p-4'>
                <li className='p-4 border-b border-b-gray-500'>Home</li>
                <li className='p-4 border-b border-b-gray-500'>About</li>
                <li className='p-4 border-b border-b-gray-500'>Contact</li>
                <li className='p-4'>Login</li>  
              </ul>  
          </div>
      </div>
  )
}
export default Navbar
